import React from 'react';
import { IonPage, IonBackButton, IonButtons, IonToolbar, IonHeader, IonContent, IonTitle, IonLabel, IonIcon, IonItem } from '@ionic/react';
import tools from '../components/Tools';
import { arrowBack } from 'ionicons/icons';
import Widgets from './../components/Widgets';


const Help:React.FC = () =>{
    return(
        <IonPage>
            <Widgets.routes/>
            <IonHeader>
                <IonToolbar>
                    <IonItem>
                        <IonIcon icon={arrowBack} onClick={()=>{tools.clickById("home")}}/>
                        <IonTitle>Help</IonTitle>
                    </IonItem>
                </IonToolbar>
            </IonHeader>
            <IonContent>
                <div style={{marginTop:"40%",marginBottom:"40%",textAlign:"center"}}>
                    <IonLabel>Comming soon</IonLabel>
                </div>

            </IonContent>

        </IonPage>
    )
}

export default Help;
